import React, { useState, useEffect } from 'react';
import Slider from 'react-slick';
import { Article } from '../../types';
import './Articles.css';

interface ArticlesProps {
  articles: Article[];
}

const Articles: React.FC<ArticlesProps> = ({ articles }) => {
  const [currentSlide, setCurrentSlide] = useState(0);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    // Simulate loading
    const timer = setTimeout(() => setIsLoading(false), 1000);
    return () => clearTimeout(timer);
  }, []);

  const sliderSettings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 2000,
    beforeChange: (current: number, next: number) => setCurrentSlide(next),
    responsive: [
      {
        breakpoint: 768,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1
        }
      }
    ]
  };

  if (isLoading) {
    return (
      <section className="section" id="blog">
        <div className="container">
          <h2 className="mb-5">Latest <span className="text-danger">Articles</span></h2>
          <div className="text-center">
            <div className="spinner-border text-danger" role="status">
              <span className="sr-only">Loading...</span>
            </div>
          </div>
        </div>
      </section>
    );
  }

  return (
    <section className="section" id="blog">
      <div className="container">
        <h2 className="mb-5">Latest <span className="text-danger">Articles</span></h2>
        <div className="row">
          <div className="article-slider">
            <Slider {...sliderSettings}>
              {articles.map((article) => (
                <div key={article.id} className="slide">
                  <div className="blog-card pl-0">
                    <div className="img-holder">
                      <img 
                        src={article.image} 
                        alt={article.title}
                        loading="lazy"
                      />
                    </div>
                    <div className="content-holder">
                      <h6 className="title">{article.title}</h6>
                      <p className="post-details">
                        <a href="#">By: Saqib Zafar</a>
                        <a href="#">
                          <i className="ti-heart text-danger"></i> {article.likes}
                        </a>
                        <a href="#">
                          <i className="ti-comment"></i> {article.comments}
                        </a>
                      </p>
                      <p>{article.description}</p>
                      <div className="d-flex align-items-center justify-content-between">
                        <a 
                          href={article.url}
                          target="_blank" 
                          rel="noopener noreferrer"
                          className="mt-0 read-more text-danger f-14"
                        >
                          <i className="ti-time text-danger" aria-hidden="true"></i>
                          <span> {article.readTime}</span>
                        </a>
                        <a 
                          href={article.url}
                          className="mt-0 read-more text-danger f-14" 
                          target="_blank"
                          rel="noopener noreferrer"
                        >
                          Read more <i className="ti-angle-double-right"></i>
                        </a>
                      </div>
                    </div>
                  </div>
                </div>
              ))}
            </Slider>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Articles;
